/94 av Super Power: \\\"På den taktiska fronten kunde man bl a meddela att man fr o m nu tar hand om distributionen åt Hudson Soft (som tidigare haft avtal med Sony) vilket innebär at bl a Super Bomberman 2, An American Tail (Fievel i Vilda Västern) och Beauty & the Beast släpps genom Virgin.\\\". Lirod fortsätter med: \\\"Detta förklarar varför Sony inte ger ut Super Bomberman 2, vilket Bergsala senare gjorde. Bergsala tackade förmodligen nej till denna [An American Tail: Fievel Goes West] titel och vi kan nog räknade denna som en riktig gråimport.\\\". Det säljs FÅ exemplar, om ens kompletta.\" }','standard','2019-08-21 15:17:23','2019-08-21 15:17:23'),(10,247,'SNSP-TW-SCN','1',NULL,'SNSP-TW-SCN','SNSP-TW-SCN',NULL,NULL,NULL,NULL,NULL,'{ \"text\": null }','standard','2019-08-21 15:17:23','2019-08-21 15:17:23'),(11,428,'SNSP-AW7P-EUR','1',NULL,'SNSP-AW7P-EUR, Svensk folder','SNSP-AW7P-EUR',NULL,NULL,NULL,NULL,NULL,'{ \"text\": null }','standard','2019-08-21 15:17:23','2019-08-21 15:17:23'),(12,401,'SNSP-ASDP-EUR','1',NULL,'SNSP-ASDP-EUR','SNSP-ASDP-EUR',NULL,NULL,NULL,NULL,NULL,'{ \"text\": \"Manual och kartong med svensk text.\" }','standard','2019-08-21 15:17:23','2019-08-21 15:17:23'),(13,343,'SNSP-A9-EUR','1',NULL,'SNSP-A9-EUR, A4 manual','SNSP-A9-EUR',NULL,NULL,NULL,NULL,NULL,'{ \"text\": null }','standard','2019-08-21 15:17:23','2019-08-21 15:17:23'),(14,362,'SNSP-A6-NNOE','1',NULL,'SNSP-A6-NNOE, A4 manual','SNSP-A6-EUR','SNSP-A6-EUR','11',NULL,NULL,'SNSP-NOE-1','{ \"text\": \"Innehåller två (2) reklamblad. Ett (1) reklamblad för vanliga SNES titlar och ett (1) annat reklamblad för GameBoy och Nintendo64.\", \"Reklamblad 1\": \"P-SNES-NOE-1\", \"Reklamblad 2\": \" P-NUS (NOE)-NOE 1\" }','standard','2019-08-21 15:17:23','2019-08-21 15:17:23'),(15,339,'SNSP-XE-?','1',NULL,'SNSP-XE-? Svenskt häfte (mycket tjockare än foldern till version 2, häftad rygg)','SNSP-XE-?',NULL,NULL,NULL,NULL,NULL,'{ \"text\": null }','standard','2019-08-21 15:17:23','2019-08-21 15:17: